create database caltex default charset=utf8;
create user 'caltex'@'localhost' identified by 'password';
grant all on caltex.* to 'caltex'@'localhost';
-- set password for 'caltex'@'localhost' = password('');

use caltex;
create table stations (
  id        serial,
  state     nvarchar(256),
  suburb    nvarchar(1024),
  address   nvarchar(1024),
  postcode  varchar(16),
  latitude  decimal(20,15),
  longitude decimal(20,15)
);

